import Counter from "../components/hooks/Counter";
import Stopwatch from "../components/hooks/StopWatch";


export default function Home() {


    return(
    <div>
        <li>Counter App</li>
        <Counter/>
        <li>Todo List ✓</li>
        <li>Search Filter ✓</li>
        <li>Tabs Component</li>
        <li>Stopwatch/Timer ✓</li>

        <Stopwatch/>

        {/* Forms & Validation */}
        <li>Form Validation - should do - righ tnow in next 15 minutes</li>

        <li>Dynamic Form</li>
        <li>Multi-Step Form</li>
        {/* Lists & API Integration */}
        <li>Fetch API Data - should do - re practice</li>
        <li>Pagination - must do</li>
        <li>Infinite Scroll - must do</li>
        <li>Sorting & Filtering - should do</li>
        <li>Theme Switcher</li>
        <li>Cart System - must do</li>
        <li>Global State - must do</li>

    </div>
    );
}
